"use strict";
var test = '';
function parseJsonFromBuffer(jsonBuffer, encoding) {
    try {
        var strBuffer = Buffer.from(jsonBuffer).toString();
        var stringResult = Buffer.from(strBuffer, encoding).toString(); // transform base 64 env var to string
        var res = JSON.parse(stringResult);
        return res;
    }
    catch (error) {
        throw new Error('unable to parse payload, invalid JSON');
    }
}
